import { IS_TEST } from 'constants/environment'
import * as urls from 'constants/urls'

export default () => {
  const redBase64 = ''
  const blueBase64 = ''
  const yellowBase64 = ''
  const randomFiles = ['red.pdf', 'yellow.pdf', 'blue.pdf']

  const files: {[k: string]: string} = {
    'red.pdf': redBase64,
    'yellow.pdf': yellowBase64,
    'blue.pdf': blueBase64
  }

  if (urls.HOST === 'localhost' && !IS_TEST) {
    const randomFile = Math.floor(Math.random() * 3)
    const fileName = randomFiles[randomFile]
    return {
      name: randomFiles[randomFile],
      size: files[fileName].length,
      mimetype: 'application/pdf',
      content: {
        base64: files[fileName]
      }
    }
  }
  return undefined
}


